CXA ON VIEW: ‘The Yellow Wallpaper’ by Kehinde Wiley, at the William Morris Gallery.

The Yellow Wallpaper’ is the first solo exhibition of new work shown by Wiley at a UK museum as well as the first to feature exclusively female portraits. The exhibit features women that the artist met on the streets of Dalston and offers a visual response to American novelist Charlotte Perkins Gilman’s acclaimed feminist text, The Yellow Wallpaper (1892). In Wiley’s new portraits, each woman is positioned as autonomous, as powerful, as open to individual interpretation and as an emblem of strength within a society of complicated social networks. They wholly embody myriad positions with regard to social class, status, religion, colonialism and the negotiation of gender.

For over fifteen years Wiley has sourced William Morris’s iconic floral designs for his paintings. Building on his interest in the relationship between the human body and the decorative, Wiley’s models are depicted in reimagined fields inspired by the William Morris oeuvre. Wiley’s portraits offer a rubric through which to engage with the beautiful yet fraught histories and traditions that black women — and all women — are heir to.

Featured Images: ‘The Yellow Wallpaper’ at the William Morris Gallery, UK.

